// import SimplePeerWrapper from 'simple-peer-wrapper';
// import wrtc from 'wrtc';

const options = {
  serverUrl: 'http://localhost:8081',
  debugger: false,
  simplePeerOptions: {
    initiator: false,
    trickle: false,
    wrtc: wrtc
  }
};

function rree() {
  const spw = new SimplePeerWrapper(options);
  console.log("ehek")
  spw.connect();
  spw.on('connect');
  spw.on('data', (data) => {
    data.data;
  });

}

